import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import styles from './SuperAdminDashboard.module.css';

const SuperAdminDashboard = () => {
  const [stats, setStats] = useState({
    totalRequests: 0,
    completedRequests: 0,
    pendingRequests: 0,
    totalResidents: 0,
    totalAdmins: 0
  });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchData = async () => {
      try {
        const [requestsRes, residentsRes, adminsRes] = await Promise.all([
          axios.get('http://localhost:8080/requests'),
          axios.get('http://localhost:8080/users/count'),
          axios.get('http://localhost:8080/admins/count')
        ]);

        const completed = requestsRes.data.filter(r => r.status === 'Completed').length;
        
        setStats({
          totalRequests: requestsRes.data.length,
          completedRequests: completed,
          pendingRequests: requestsRes.data.length - completed,
          totalResidents: residentsRes.data.count,
          totalAdmins: adminsRes.data.count
        });
      } catch (err) {
        setError('Failed to load dashboard data');
        console.error(err);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  if (loading) return <div className={styles.container}>Loading dashboard...</div>;
  if (error) return <div className={styles.container}>{error}</div>;

  return (
    <div className={styles.container}>
      <h2>Super Admin Dashboard</h2>
      <div className={styles.cards}>
        <div className={styles.card}>
          <h4>Total Requests</h4>
          <p>{stats.totalRequests}</p>
        </div>
        <div className={styles.card}>
          <h4>Completed</h4>
          <p>{stats.completedRequests}</p>
        </div>
        <div className={styles.card}>
          <h4>Pending</h4>
          <p>{stats.pendingRequests}</p>
        </div>
        <div className={styles.card}>
          <h4>Total Residents</h4>
          <p>{stats.totalResidents}</p>
        </div>
        <div className={styles.card}>
          <h4>Total Admins</h4>
          <p>{stats.totalAdmins}</p>
        </div>
      </div>

      <div className={styles.actions}>
        <Link to="/reports" className={styles.reportsButton}>View Reports</Link>
        <Link to="/manage-users" className={styles.manageButton}>Manage Users</Link>
        <Link to="/manage-admins" className={styles.manageButton}>Manage Admins</Link>
      </div>
    </div>
  );
};

export default SuperAdminDashboard;
